import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import HeatMap from './HeatMap';
import Measurements from './Measurements';
import WorkoutRoutine from './WorkoutRoutine';
import MembershipStatus from './MembershipStatus';

const TrainerDashboard = () => {
  return (
    <div>
      <nav>
        <ul style={{ display: 'flex', justifyContent: 'space-around', listStyle: 'none', padding: '20px 0' }}>
          <li><Link to="/dashboard/heatmap">Gym Attendance</Link></li>
          <li><Link to="/dashboard/edit-measurements">Edit Measurements</Link></li>
          <li><Link to="/dashboard/edit-workout">Edit Workout</Link></li>
          <li><Link to="/dashboard/memberships">Membership Status</Link></li>
        </ul>
      </nav>

      <Switch>
        <Route path="/dashboard/heatmap" component={HeatMap} />
        <Route path="/dashboard/edit-measurements" component={Measurements} />
        <Route path="/dashboard/edit-workout" component={WorkoutRoutine} />
        <Route path="/dashboard/memberships" component={MembershipStatus} />
      </Switch>
    </div>
  );
};

export default TrainerDashboard;
